import React from 'react'

export default class CategoryContainer extends React.Component {

    renderCatButtons = () => {
        return this.props.cats.map(category => <CatButton name={category} />)
    }

    render(){
        return(
            <div className="categories">
                {this.renderCatButtons}
            </div>
        )
    }
}
